import React from "react";

export default function List({ list, lists, setTasks, key, setCurrentList }) {
  function changeList() {
    setTasks(list.tasks);
    setCurrentList(list.id);
  }

  return (
    <div onClick={changeList}>
      <div>{list.name}</div>
    </div>
  );
}
